/**
 * @param {number[]} numbers
 * @param {number} target
 * @return {number[]}
 */
const twoSum = function(numbers, target) {
    let answerArray = [];

    for (let i = 0; i < numbers.length; i ++) {
        let numberDiff = target - numbers[i];
        let otherNumberIndex = binarySearch(numbers, numberDiff, i);

        if (otherNumberIndex && !answerArray.includes(i + 1) && !answerArray.includes(otherNumberIndex + 1)) {
            answerArray.push(i + 1, otherNumberIndex + 1);
        }
    }

    return answerArray;
};

// Only return an index which isn't the same as the current index
function binarySearch(array, target, currentIndex) {
    let left = 0;
    let right = array.length - 1;
    let mid;

    while (left <= right) {
        mid = Math.floor((left + right) / 2);

        if (array[mid] === target) {
            if (mid !== currentIndex) {
                // Have found an index which is different from the current index
                return mid;
            }
            // Otherwise the index is the same as where the search was made from, so move right
            left = mid + 1;
        } else if (array[mid] < target) {
            left = mid + 1;
        } else {
            right = mid - 1;
        }
    }

    return null;
}

